const Modal = ({ data }) => {
    function handleClick(event) {
        const lat = event.latLng.lat()
        const lng = event.latLng.lng()
    }
    return(
        <div>
            <img onClick={(e) => handleClick(e)} src={data.path} alt={data.name} />
        </div>
    )
}

export default Modal;
